hernder Farn auf Parkettfußböden. Mithilfe der zerstörerischen Kraft des Wassers - wenn es ein Haus vom Dach bis zum Keller durchströmt und seine Spuren an Decken und Wänden, Anstrichen und Tapeten, Inventar und Installation hinterlässt - erobert sich die Natur ihren Lebensraum zurück. In all dem Chaos kurz vor dem endgültigen Untergang finden sich Botschaften aus der Vergangenheit, von der einstigen Bestimmung, den einstigen Bewohnern und Nutzern: zurückgelassene Möbel, alte Zeitungen, verrostetes Werkzeug, stehengebliebene Uhren.</p>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', '', 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, 0, 0, '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', NULL, '', '', '', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '', '', '', '', '', '', NULL);
