nordwestlich von der Landeshauptstadt Dresden an der Mündung von Triebisch und Meisa in die Elbe.&nbsp;929 wurde die Burg Meißen und die Markgrafschaft Meißen auf dem Bergsporn über der Elbe gegründet. Meißen gehört zu den am nördlichsten gelegenen Weinanbaugebieten in Deutschland und befindet sich mitten im Herzen der Sächsischen Weinstraße. Bekannt wurde die im Jahre 1150 ertmals als “civitas” bezeichete Stadt durch die erste europäische Porzellanmanufaktur und deren charakteristische “Blauen Schwerter”.</p>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', '', 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, 0, 0, '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', NULL, '', '', '', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '', '', '', '', '', '', NULL);
INSERT INTO `tl_content` (`id`, `type`, `pid`, `ptable`, `sorting`, `tstamp`, `headline`, `text`, `addImage`, `showPreview`, `inline`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imageUrl`, `fullsize`, `caption`, `floating`, `html`, `listtype`, `listitems`, `tableitems`, `summary`, `thead`, `tfoot`, `tleft`, `sortable`, `sortIndex`, `sortOrder`, `mooHeadline`, `mooStyle`, `mooClasses`, `highlight`, `markdownSource`, `code`, `url`, `target`, `overwriteLink`, `titleText`, `linkTitle`, `embed`, `rel`, `useImage`, `multiSRC`, `useHomeDir`, `perRow`, `perPage`, `numberOfItems`, `sortBy`, `metaIgnore`, `galleryTpl`, `customTpl`, `playerSRC`, `youtube`, `vimeo`, `posterSRC`, `playerSize`, `playerOptions`, `playerStart`, `playerStop`, `playerCaption`, `playerAspect`, `splashImage`, `playerPreload`, `playerColor`, `youtubeOptions`, `vimeoOptions`, `sliderDelay`, `sliderSpeed`, `sliderStartSlide`, `sliderContinuous`, `data`, `cteAlias`, `articleAlias`, `article`, `form`, `module`, `protected`, `groups`, `cssID`, `invisible`, `start`, `stop`, `ct_sliderElement_playerSRC`, `ct_sliderElement_subHeadline`, `ct_sliderElement_target`, `ct_sliderElement_linkText`, `ct_sliderElement_page`, `ct_wrapper_name`, `ct_teaserBox_customTpl`, `ct_teaserBox_pageTitle`, `ct_teaserBox_pageText`, `ct_teaserBox_page`, `ct_priceBox_customTpl`, `ct_popularPriceBox`, `ct_priceBox_linkText2`, `ct_priceBox_link2`, `ct_priceBox_linkText1`, `ct_priceBox_link1`, `ct_priceLabel`, `ct_price`, `ct_featureElement_customTpl`, `ct_iconLink`, `ct_featureIcon`, `ct_contentBox_customTpl`, `ct_contentBox_pageTitle`, `ct_contentBox_pageText`, `ct_contentBox_page`, `advancedCss`, `odd_subHeadline`, `odd_linkText`, `odd_page`, `unfilteredHtml`) VALUES (726, 'text', 159, 'tl_article', 256, 1552650787, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:0:\"\";}', '<p style=\"text-align: justify;\">Stadterkunden in Meißen auf eine ganz besondere Art - mit der Kamera unterwegs in Häusern, die seit Jahren kein Mensch mehr betreten hat und in denen die Zeit scheinbar stehen geblieben ist. \"Urban Exploring\" wird diese Art der privaten Entdeckung städtischer Refugien genannt, die der Öffentlichkeit seit Jahrzehnten verborgen waren.</p>\n<p style=\"text-align: justify;\">Oft sind die Bauten von außen sehr bekannt und mancher Meißner erinnert sich noch an ihr \"Innenleben\", war im \"Hamburger Hof\" zum Tanzvergnügen, im Landkrankenhaus zur Reihenuntersuchung, lernte in der Zaschendorfer Schule oder arbeitete in der Schuhfabrik. Doch wie sieht es jetzt dort aus? Was ist aus diesen Orten geworden?</p>\n<p style=\"text-align: justify;\">Die Bilder sind faszinierend und erschütternd zugleich. Die Räume versprühen einen morbiden Charme - verrostete Maschinen, morsche Diehlen, wuchernder Farn auf Parkettfußböden. Mithilfe der zerstörerischen Kraft des Wassers - wenn es ein Haus vom Dach bis zum Keller durchströmt und seine Spuren an Decken und Wänden, Anstrichen und Tapeten, Inventar und Installation hinterlässt - erobert sich die Natur ihren Lebensraum zurück. In all dem Chaos kurz vor dem endgültigen Untergang finden sich Botschaften aus der Vergangenheit, von der einstigen Bestimmung, den einstigen Bewohnern und Nutzern: zurückgelassene Möbel, alte Zeitungen, verrostetes Werkzeug, stehengebliebene Uhren.</p>\n<p style=\"text-align: justify;\"><strong>Nimm nichts mit außer Fotografien. Lass nichts zurück außer Fußabdrücke.</strong></p>', 0, 0, 0, 0, 0xecca9086ff5b11e78700408d5c22fa41, '', '', 'a:3:{i:0;s:3:\"200\";i:1;s:0:\"\";i:2;s:12:\"proportional\";}', '', 1, '', 'right', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', '', 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, 0, 0, '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:13:\"bordered-left\";}', 0, '', '', NULL, '', '', '', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '', '', '', '', '', '', NULL);
