ensch mehr betreten hat und in denen die Zeit scheinbar stehen geblieben ist. \"Urban Exploring\" wird diese Art der privaten Entdeckung städtischer Refugien genannt, die der Öffentlichkeit seit Jahrzehnten verborgen waren.</p>\n<p style=\"text-align: justify;\">Oft sind die Bauten von außen sehr bekannt und mancher Meißner erinnert sich noch an ihr \"Innenleben\", war im \"Hamburger Hof\" zum Tanzvergnügen, im Landkrankenhaus zur Reihenuntersuchung, lernte in der Zaschendorfer Schule oder arbeitete in der Schuhfabrik. Doch wie sieht es jetzt dort aus? Was ist aus diesen Orten geworden?</p>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', '', 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, 0, 0, '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', NULL, '', '', '', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '', '', 'col-12 col-md-6', '', '', '', NULL);
