r einer Sanierung, die alle Spuren der Vergangenheit verwischen werden. Sie wurden sorgfältig dokumentiert, ohne am Ort etwas zu verändern. Da die Fotografien grundsätzlich im - oft sehr spärlichen - natürlichen Licht vor Ort aufgenommen wurden, kam meist die HDR-Technik zum Einsatz, die</p>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', '', 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, 0, 0, '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', NULL, '', '', '', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '', '', 'col-12 col-md-6', '', '', '', NULL);
