Mensch mehr betreten hat und in denen die Zeit scheinbar stehen geblieben ist. \"Urban Exploring\" wird diese Art der privaten Entdeckung städtischer Refugien genannt, die der Öffentlichkeit seit Jahrzehnten verborgen waren.</p>\n<p style=\"text-align: justify;\">Oft sind die Bauten von außen sehr bekannt und mancher Meißner erinnert sich noch an ihr \"Innenleben\", war im \"Hamburger Hof\" zum Tanzvergnügen, im Landkrankenhaus zur Reihenuntersuchung, lernte in der Zaschendorfer Schule oder arbeitete in der Schuhfabrik. Doch wie sieht es jetzt dort aus? Was ist aus diesen Orten geworden?</p>', 0, 0, 0, 0, 0xecca9086ff5b11e78700408d5c22fa41, '', '', 'a:3:{i:0;s:3:\"200\";i:1;s:0:\"\";i:2;s:12:\"proportional\";}', '', 1, '', 'right', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', '', 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, 0, 0, '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:13:\"bordered-left\";}', 0, '', '', NULL, '', '', '', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '', '', '', '', '', '', NULL);
