r\" Jahn erhielt die Halle den offiziellen Namen Friedrich-Ludwig-Jahn-Turnhalle.</p>', 1, 0, 0, 0, 0xc416cb81467611e9a91c408d5c22fa41, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:2:\"24\";}', '', 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', '', 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, 0, 0, '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', NULL, '', '', '', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '', '', '', 'Sport', 'Mehr erfahren', '{{event_url::27}}', NULL);
