Unter anderem war das 7. Garde-Panzerregiment der GSSD hier untergebracht.</p>', 1, 0, 0, 0, 0xccb24364467611e9a91c408d5c22fa41, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:2:\"24\";}', '', 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', '', 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, 0, 0, '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', NULL, '', '', '', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '', '', '', 'Militär', 'Mehr dazu', '{{news_url::12}}', NULL);
